INSERT INTO `clues` VALUES ('466', '4', '01+degrees+24+minutes+north%2C+08+degrees+05+minutes+west+', '3', 'In+the+hunter+area+directly+south+of+the+Elf+Camp%2C+past+a+stick+trap%2C+dig+by+the+north-east+edge+of+the+pond.+An+Elf+camp+teleport+can+greatly+reduce+the+difficulty+in+reaching+this+position.+From+Lletya%3A+Pass+the+tree%2C+go+west+across+the+tripwire%2C+continue+west+through+the+dense+forest.+Turn+north+and+up+the+path+to+Prifddinas.+Before+the+bridge+and+the+water%2C+head+west+through+the+dense+forest.+Then+keep+going+west+past+the+leaves+pitfall+trap%2C+then+south-west+past+a+stick+trap.+From+Port+Tyras%3A+Go+north+through+dense+forest+then+east%3B+go+south+through+dense+forest%3B+step+over+tripwire%3B+go+east+through+the+dense+forest+then+north-west+for+quite+a+while%3B+jump+over+the+leaves.+Finally%2C+continue+west+till+you+arrive+at+a+elven+lamp+next+to+mushrooms.+Head+south+down+the+small+path+to+the+pond.+Pass+the+stick+trap+and+dig+by+the+north-east+edge+of+the+pond.+This+clue+can+be+frustrating+due+to+the+frequency+of+activating+the+stick+traps%2C+which+deal+significant+amounts+of+damage.+There+is+a+better+success+rate+of+passing+the+trap+by+turning+off+run+and+walking+past+the+trap.+It%27s+recommended+to+follow+this+map+in+order+to+not+get+lost.++', '%3Cimg+src%3D%27http%3A%2F%2Fvignette1.wikia.nocookie.net%2F2007scape%2Fimages%2Fd%2Fd9%2FCoordinate_clue_01.24N_08.05W.png%2Frevision%2Flatest%2F%27%2F%3E', '1', '24', 'N', '8', '5', 'W', NULL);
